def continuity_test(districts):
    """Make sure each district is continuous"""
    for tag in range(1,6):
        if tag in districts:
            X = np.where((districts==tag)|(districts==0))
            contig = set([(X[0][0],X[1][0])])
            prev_len = 0
            while len(contig) > prev_len and prev_len<5:
                prev_len = len(contig)
                for r,c in contig.copy():
                    if r>0 and districts[r-1,c] in [tag,0]:
                        contig.add((r-1,c))
                    if r<4 and districts[r+1,c] in [tag,0]:
                        contig.add((r+1,c))
                    if c>0 and districts[r,c-1] in [tag,0]:
                        contig.add((r,c-1))
                    if c<4 and districts[r,c+1] in [tag,0]:
                        contig.add((r,c+1))
            if prev_len < 5:
                return False
    return True

def neighbors(districts, r, c):
    """List the neighbors' values around a particular cell."""
    n_list = []
    if r>0:
        n_list += [districts[r-1,c]]
    if r<4:
        n_list += [districts[r+1,c]]
    if c>0:
        n_list += [districts[r,c-1]]
    if c<4:
        n_list += [districts[r,c+1]]
    return n_list

def assign_cell(districts):
    """Recursively build hypothetical district maps."""
    hyp_dists = []
    created_district = False
    #Find the next unassigned cell:
    unassigned = np.where(districts==0)
    r = unassigned[0][0]
    c = unassigned[1][0]
    #Try setting the cell to each possible tag:
    # continuity_count(districts,1,r,c)
    for tag in range(1,6):
        #Make sure we havent skipped a tag:
        if (tag not in districts and not created_district) or (tag in districts):
            #Make sure we havent exceeded 5 cells with this tag:
            if (districts == tag).sum() < 5:
                if tag not in districts:
                    #It doesnt make sense to create a new district with each tag, so make sure we only do it once per cell:
                    created_district = True
                #This tag might work, so create a hypothetical case from it:
                hyp = np.copy(districts)
                hyp[r,c] = tag
                if continuity_test(hyp):
                    #See if the hypothetical map is complete:
                    if 0 in hyp:
                        hyp_dists += assign_cell(hyp)
                    else:
                        hyp_dists += [hyp]
    if r==2 and c==2:
        print(len(hyp_dists))
    return hyp_dists

def build_table():
    #Create a blank district map:
    districts = np.zeros((5,5),dtype=np.int8)
    #Generate all valid district maps:
    newdists = assign_cell(districts)
    #Print maps:
    print('[',end='')
    for dmap in newdists:
        print('[',end='')
        for r,row in enumerate(dmap):
            print('[',end='')
            for c,n in enumerate(row):
                print(n,end='')
                if c!=4:
                    print(',',end='')
            print(']',end='')
            if r!=4:
                print(',',end='')
        print('],',end='')

    print(']',end='')
    return None

def gerrymander(s):
    matmap = np.array([list(line) for line in s.split('\n')])
    for dmap in MAPS:
        wins = 0
        for tag in range(1,6):
            dvotes = matmap[np.where(np.array(dmap)==tag)]
            if (dvotes=='O').sum() > 2:
                wins += 1
        if wins>2:
            out = ''
            for row in dmap:
                for c in row:
                    out += str(c)
                out += '\n'
            return out[:-1]
    return None


